import matplotlib.pyplot as plt
from statsmodels.tsa.holtwinters import ExponentialSmoothing, SimpleExpSmoothing, Holt
import pandas as pd


# In[127]:


class predict():
    def __init__(self,  exponential=True, smoothing_level=0.8, smoothing_trend=0.2, optimized=True, damped_trend = True):
        self.exponential = exponential
        self.smoothing_level = smoothing_level
        self.smoothing_trend = smoothing_trend
        self.optimized = optimized
        self.damped_trend = damped_trend
    def pre(self, request_rate, rounds):
        request_rate_series = pd.Series(data = request_rate, index = range(rounds))
        #print(request_rate_series)
        request_rate_series = request_rate_series.fillna(0).add(1)
        model = Holt(request_rate_series,exponential = self.exponential, damped_trend = self.damped_trend )
        #print(request_rate_series)
        fit = model.fit(smoothing_level = self.smoothing_level, smoothing_trend = self.smoothing_trend, optimized = self.optimized)        
        #fit = model.fit(smoothing_level = self.smoothing_level, smoothing_slope = self.smoothing_slope, optimized = self.optimized)
        #print(fit.forecast(1))
        return fit.forecast(1).values
#predict = predict()  
#print(predict.pre({0:1,3:4, 8:10},9))
    def get_prediction_result(self, data, round):
        result = {}
        for node in data.keys():
            forecast = {}
            for content in data[node].keys():
                #print(forecast[content])
                forecast[content] = self.pre(data[node][content], round)

        
            result[node] = dict(sorted(forecast.items(), key=lambda item: item[1], reverse = True))
        #print("##############################")
        #print(result)
        #self.store_result(result)
        return result
